import React from "react";

const GenericTable = ({
    tableName,
    tableHeaderComponent,
    tableInfoComponent,
    editButtonComponent,
    deleteButtonComponent,
    createButtonComponent,
}) => {
    return (
        <section>
            <h2>{tableName}</h2>
            <div className="divTable">
                <div className="headRow">
                    {tableHeaderComponent /* Component for table header */}
                </div>
                <div className="divRow">
                    {tableInfoComponent /* Component for table information */}
                    {editButtonComponent /* Component button to edit */}
                    {deleteButtonComponent /* Component button to delete */}
                </div>
            </div>
            <div>
                {
                    createButtonComponent /* Component button to create new line */
                }
            </div>
        </section>
    );
};

export default GenericTable;
